    return (
        <Container>
            <Header />

            <div className="conteudo">
                <div className="barraEsquerda">
                
                </div>


                <div className="barraCentral">
                <Post />
                <Post />

                </div>


                <div className="barraDireita"><h1>3</h1></div>
            </div>
        </Container>
            

        



    )

}

export default HomeFeed;
